00Modernization was done on a high-speed USB ports in the latest version 30thThe flagship of modern technology is an innovative interface "Thunderbolt", which provides power to the device and transfer data at speeds up to 10 Gbps.With optional adapters can be used for example as DisplayPort.&nbsp;<br/><br/>Working in the operating system Apple Mac OS X Lion is very simple and effective.The operating system is precisely adapted to the hardware, so the work is very nimble.This version of the laptop is equipped with a Czech keyboard with backlight practical and comfortable cursor control is ensured thanks multidotykovmu touchpad for scrolling pages, rotate images, and more.&nbsp;<br/><br/><strong>Specifications:</strong>&nbsp;<br/><br/><strong>Processor:</strong>&nbsp;<br/>Intel Core i5 processor with a frequency of 2.5 GHz&nbsp;<br/>2 cores&nbsp;<br/>Intel Turbo Boost 2 with a frequency of 3.1 GHz&nbsp;<br/><br/><strong>Memory:</strong>&nbsp;<br/>4 GB DDR3 1600 MHz&nbsp;<br/><br/><strong>Display:</strong>&nbsp;<br/>13.3 "TFT LCD with LED backlightshiny&nbsp;<br/>Resolution: 1280 x 800 pixels&nbsp;<br/><br/><strong>Graphic card:</strong>&nbsp;<br/>Intel HD Graphics 4000&nbsp;<br/><br/><strong>Hard Drive:</strong>&nbsp;<br/>500 gigabytes&nbsp;<br/>5400 RPM&nbsp;<br/><br/><strong>Optical drive:</strong>&nbsp;<br/>DVD  RW&nbsp;<br/><br/><strong>Multimedia:</strong>&nbsp;<br/>Built-in microphone&nbsp;<br/>Integrated speakers&nbsp;<br/>Built-in FaceTime HD webcam (720p)&nbsp;<br/><br/><strong>Communication:</strong>&nbsp;<br/>Network Card 10/100/1000BASE-T Gigabit Ethernet&nbsp;<br/>WiFi 802nd11n (802nd Support11 a/b/g)&nbsp;<br/>Bluetooth fourth0 + EDR&nbsp;<br/><br/><strong>Control:</strong>&nbsp;<br/>Czech keyboard with backlight&nbsp;<br/>MultiTouchpad&nbsp;<br/><br/><strong>Interface:</strong>&nbsp;<br/>1x Thunderbolt port (up to 10Gbps)&nbsp;<br/>2x USB third0 (up to 5 Gbps)&nbsp;<br/>1x FireWire 800&nbsp;<br/>1x Headphone/Mic&nbsp;<br/>1x RJ-45&nbsp;<br/>1x SDXC card slot&nbsp;<br/>1x Power input - MagSafe&nbsp;<br/><br/><strong>Consumption:</strong>&nbsp;<br/>Li-Pol battery (63.5 Wh)&nbsp;<br/>Battery life up to 7 hours&nbsp;<br/>AC Adapter MagSafe 60 W&nbsp;<br/><br/><strong>Dimensions:</strong>&nbsp;<br/>325 x 227 x 24.1 mm&nbsp;<br/><br/><strong>Weight:</strong>&nbsp;<br/>2.06 kg&nbsp;<br/><br/><strong>Operating System:</strong>&nbsp;<br/>Apple Mac OS X Lion</div>', '2013-06-27 00:00:00', 3, 27099, , '2013-02-17 00:00:00', NULL, 'Notebook - Intel Core i5 2.5GHz Dual-Core Ivy Bridge, 13.3 "LED 1280x800, RAM 4GB, Intel Graphics HD 4000, 500GB 5400 rpm HDD, DVD, WiFi, Bluetooth 4.0, Webcam, USB 3.0, Thunderbolt port SDXC card reader, MAC OS X', 'APPLE MacBook Pro 13" CZ', 2, 2);
